window.bookSummaryJSON = "<p><i>A steamy Forced Proximity Secret Society Romance by Bestselling Author Natasha Knight.</i><br> <br> <b><i>I crossed him. Now he owns me.</i></b><br> <br> When I tried to blackmail Ezekiel St. James, I thought it would be easy.<br> <br> Turns out I had no idea who I was dealing with.<br> <br> The moment his steel-grey eyes locked on mine, I knew the game was over.<br> <br> He knew exactly who I was. What I’d done.<br> <br> And he wasn’t going to let me walk away.<br> <br> With his immense wealth and power, he had me kidnapped.<br> <br> He could make me disappear.<br> <br> I’m no easy prey, though, and it’s not just my life on the line. I have to protect my sister.<br> <br> But when I’m hurt, he does the unexpected. He takes care of me.<br> <br> In some twisted way, he sees his atonement in me.<br> <br> Desperate and vulnerable, I need protection.<br> <br> He offers his, but his terms are as grey as his morals. I’ll be his in every way.<br> <br> I accept knowing full well the risk. Because when he touches me, my skin catches fire.<br> <br> And there’s something inside me that wants to belong to him.</p>"; 
